Any parameters that are Option<T> types are automatically treated as optional with a default value of None. For example use tokio::time::{self, Duration}; #[celery::task]
async fn delay(secs: Option<u64>) { let secs = secs.unwrap_or(10); time::delay_for(Duration::from_secs(secs)).await;
} So you could call this task from Python with or without providing a value for secs: celery_app.send_task("sleep", args=[10])
celery_app.send_task("sleep")

