You can set custom callbacks to run when a task fails or succeeds through the on_failure and on_success options to the task macro: use celery::task::Task;
use celery::error::TaskError;
use tokio::time::{self, Duration}; #[celery::task( time_limit = 10, on_failure = failure_callback, on_success = success_callback,
)]
async fn sleep(secs: u64) { time::delay_for(Duration::from_secs(secs)).await;
} async fn failure_callback<T: Task>(task: &T, err: &TaskError) { match err { TaskError::TimeoutError => println!("Oops! Task {} timed out!", task.name()), _ => println!("Hmm task {} failed with {:?}", task.name(), err), };
} async fn success_callback<T: Task>(task: &T, _ret: &T::Returns) { println!("{} succeeded!", task.name());
}

