A task represents a unit of work that a Celery app can produce or consume. The recommended way to define a task is by decorating a function with the task attribute macro: use celery::prelude::*; #[celery::task]
fn add(x: i32, y: i32) -> TaskResult<i32> { Ok(x + y)
} If the function has a return value the return type must be a TaskResult<T> . Under the hood a task is just a struct that implements the Task trait. When you decorate a function with the task macro, this creates a struct and implements the Task trait so that Task::run calls the function you've defined. The macro accepts a number of optional parameters . For example, to give a task a custom name and set a time limit: use tokio::time::{self, Duration}; #[celery::task(name = "sleep", time_limit = 5)]
async fn delay(secs: u64) { time::delay_for(Duration::from_secs(secs)).await;
}

