When a task executes, i.e. when the Task::run method is called, it returns a TaskResult<T> which is just a Result<T, TaskError>. When an Err(TaskError) is returned, the worker considers the task failed and may send it back to the broker to be retried. A worker treats certain TaskError variants differently. So when your task has points of failure, such as in the read_some_file example below, you'll need to coerce those possible error types to the appropriate TaskError variant and propogate them upwards: use celery::prelude::*; #[celery::task]
async fn read_some_file() -> TaskResult<String> { tokio::fs::read_to_string("some_file") .await .with_unexpected_err(|| "File does not exist")
} Here tokio::fs::read_to_string("some_file").await produces a tokio::io::Result , so we use the helper method .with_unexpected_err from the TaskResultExt trait to convert this into a TaskError::UnexpectedError and then apply the ? operator to propogate it upwards. There are two error kinds in particular that are meant as catch-alls for any other type of error that could arise in your task: TaskError::UnexpectedError and TaskError::ExpectedError . The latter should be used for errors that will occasionally happen due to factors outside of your control - such as a third party service being temporarily unavailable - while UnexpectedError should be reserved to indicate a bug or that a critical resource is missing.
